import React from 'react';
import './App.css'; // Import your main CSS file
import Menu from './menu'
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>My React App</h1>
        <Menu>About</Menu>
        <Menu>Contact</Menu>
      </header>
    </div>
  );
}

export default App;
